// Theme Presets
const darkTheme = {
  name: "dark",
  body: "#1D1D1D",
  text: "#FFFFFF",
  dark: "#000000",
  ternaryText: "#FFFFFF",
  themeColor: "#1d1d1d",
  accentColor: "rgb(254, 220, 86);",
  accentBright: "rgb(226, 120, 108)",
}

export const themes = { dark: darkTheme }
